import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import AdminTemplate from "../../../templates/AdminTemplate";
import useMascotaViewModel from "../../../viewmodels/useMascotaViewModel";
import Button from "../../../components/atoms/Button";

const NuevaMascota = () => {
  const navigate = useNavigate();

  // Aquí NO pasamos RUT, se pasa en createMascota()
  const { createMascota } = useMascotaViewModel();

  const [formData, setFormData] = useState({
    rut: "",
    nombre: "",
    especie: "",
    raza: "",
    edad: "",
    peso: "",
  });

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData((prev) => ({ ...prev, [id]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.rut || formData.rut.trim() === "") {
      alert("Debe ingresar el RUT del cliente.");
      return;
    }

    await createMascota(
      formData.rut,  // <-- RUT
      {
        nombre: formData.nombre,
        especie: formData.especie,
        raza: formData.raza,
        edad: formData.edad,
        peso: formData.peso,
      }
    );

    navigate("/admin/clientes/mascotas/listar");
  };

  return (
    <AdminTemplate>
      <main className="flex-grow-1" id="main-content">
        <div className="container-fluid py-4">

          {/* Breadcrumb */}
          <nav aria-label="breadcrumb" className="mb-3">
            <ol className="breadcrumb mb-0">
              <li className="breadcrumb-item"><a href="/Admin">Administración</a></li>
              <li className="breadcrumb-item"><a href="/admin/clientes/mascotas">Mascotas</a></li>
              <li className="breadcrumb-item active" aria-current="page">Nueva Mascota</li>
            </ol>
          </nav>

          <div className="bg-white p-4 shadow-sm rounded">
            <h1 className="h4">Registrar Mascota</h1>

            <form onSubmit={handleSubmit}>

              {/* RUT */}
              <div className="mb-3">
                <label htmlFor="rut">RUT / ID Cliente *</label>
                <input
                  type="text"
                  id="rut"
                  required
                  placeholder="11.111.111-1"
                  className="form-control"
                  value={formData.rut}
                  onChange={handleChange}
                />
              </div>

              {/* Nombre */}
              <div className="mb-3">
                <label htmlFor="nombre">Nombre *</label>
                <input
                  type="text"
                  id="nombre"
                  required
                  className="form-control"
                  value={formData.nombre}
                  onChange={handleChange}
                />
              </div>

              {/* Especie */}
              <div className="mb-3">
                <label htmlFor="especie">Especie *</label>
                <input
                  type="text"
                  id="especie"
                  required
                  className="form-control"
                  value={formData.especie}
                  onChange={handleChange}
                />
              </div>

              {/* Raza */}
              <div className="mb-3">
                <label htmlFor="raza">Raza *</label>
                <input
                  type="text"
                  id="raza"
                  required
                  className="form-control"
                  value={formData.raza}
                  onChange={handleChange}
                />
              </div>

              {/* Edad */}
              <div className="mb-3">
                <label htmlFor="edad">Edad *</label>
                <input
                  type="number"
                  id="edad"
                  required
                  className="form-control"
                  value={formData.edad}
                  onChange={handleChange}
                />
              </div>

              {/* Peso */}
              <div className="mb-3">
                <label htmlFor="peso">Peso (kg) *</label>
                <input
                  type="number"
                  id="peso"
                  required
                  className="form-control"
                  value={formData.peso}
                  onChange={handleChange}
                />
              </div>

              <Button label="Registrar Mascota" type="submit" variant="primary" />
            </form>
          </div>
        </div>
      </main>
    </AdminTemplate>
  );
};

export default NuevaMascota;
